    type: String,
    default: '',
  },
  transcodedVideoFingerprint: {
    type: String,
    default: '',
  },
})

function shortenFingerprint (fingerprint: string) {
  if (!fingerprint) { return '-' }
  return `${fingerprint.slice(0, 6)}...${fingerprint.slice(-4)}`
}

const shortenedOriginalVideoFingerprint = computed(() => {
  return shortenFingerprint(props.originalVideoFingerprint)
})

const shortenedEditedVideoFingerprint = computed(() => {
  return shortenFingerprint(props.editedVideoFingerprint)
})

const shortenedTranscodedVideoFingerprint = computed(() => {
  return shortenFingerprint(props.transcodedVideoFingerprint)
})

