  tl.addLabel('slide4enter')
  tl.to(text04.value, { opacity: 0, duration: 1 }, 'slide4enter')

  tl.from(text05.value, { opacity: 0, duration: 1 }, 'slide4enter')
  tl.to(numbersRegistry.value, { y: '-=5%', opacity: 0, duration: 1 }, 'slide4enter')
