  tl.from(computer.value, { y: '+=100vh', duration: 3, ease: 'power3.out' })
  tl.set(mp4FileRaw.value, { opacity: 0 })
  
  tl.to(computer.value, { x: '-=20vw', duration: 1, ease: 'power3.inOut' })
